import React, { Component } from 'react';
import jwt_decode from 'jwt-decode';
import axios from 'axios';



export default class Favorite extends Component {
    constructor(props) {
        super(props);
        this.state = { favorite: [] }
    }

    componentDidMount() {
        const token = localStorage.usertoken
        const decoded = jwt_decode(token)

        axios.get('http://localhost:5000/users/favorite/' + decoded.id)
            .then(response => {
                console.log(response.data)
            })
            .catch(error => {
                console.log(error)
            })
    }

    FavoriteList(){
        return this.state.favorite.map(currentfavorite =>{
            return axios.get('http://localhost:5000/restaurants/23')
            .then(response => {
                console.log(response)
            })
        })
    }

    render() {
        return (
            <div>
                <h1>this is the page for user Restaurant Profile</h1>
                {this.FavoriteList()}
            </div>
        );
    }
}
